import React, { useState } from 'react';
import { useNavigate } from "react-router-dom";
import Navbar from '../components/Navbar';
import APIInvoke from '../utils/APIInvoke';

const RegistroForm = () => {
    const navigate = useNavigate();
    const [userType, setUserType] = useState('cliente');

    const [seguidor, setSeguidor_] = useState({
        correo_electronico: "",
        contrasena: "",
        nombre: "",
    });

    const { nombre, correo_electronico, contrasena } = seguidor;

    const setSeguidor = (e) => {
        setSeguidor_({
            ...seguidor,
            [e.target.name]: e.target.value,
        });
    };

    const register = async () => {
        // Aquí va la lógica para el registro
    };

    const onSubmit = (e) => {
        e.preventDefault();
        register();
    };

    const ClubForm = () => (
        <>
            <div>
                <label>Nombre del Club:</label>
                <input
                    type="text"
                    name="nameUser"
                    value={nombre}
                    onChange={setSeguidor}
                    required
                />
            </div>
            {/* Otros campos específicos para Club */}
        </>
    );

    const SeguidorForm = () => (
        <>
            <div>
                <label>Nombre del Seguidor:</label>
                <input
                    type="text"
                    name="nameUser"
                    value={nombre}
                    onChange={setSeguidor}
                    required
                />
            </div>
            <div>
                    <label>Correo electronico:</label>
                    <input
                        type="email"
                        name='correo_electronico'
                        value={correo_electronico}
                        onChange={setSeguidor}
                        required
                    />
                </div>
                <div>
                    <label>Contraseña:</label>
                    <input
                        type="password"
                        name='contrasena'
                        value={contrasena}
                        onChange={setSeguidor}
                        required
                    />
                </div>
        </>
    );

    return (
        <div>
            <Navbar />
            <form onSubmit={onSubmit} className="form">
                <h2>Registro</h2>
                <div>
                    <label>Tipo de Usuario:</label>
                    <select
                        value={userType}
                        onChange={(e) => setUserType(e.target.value)}
                    >
                        <option value="club">Club</option>
                        <option value="seguidor">Seguidor</option>
                    </select>
                </div>
                {userType === 'club' ? <ClubForm /> : <SeguidorForm />}
                <button type="submit">Registro</button>
            </form>
        </div>
    );
};

export default RegistroForm;
